import { Component } from '@angular/core';


@Component({
  selector: 'app-cadastrar',
  templateUrl: './cadastrar.component.html',
  styleUrls: ['./cadastrar.component.css']
})
export class CadastrarComponent {

  myFlag = false;
  getSelectedGender(male:any, female:any, others:any){
    if(male.checked){
      console.log('You have selected '+ male.value);
    }
    else if(female.checked){
      console.log('You have selected '+ female.value);
    }
    else if(others.checked){
      console.log('You have selected '+ others.value);
    }
    else{
      this.myFlag = true;
    }
  }


}
